import { colors } from "../../constants";

export const styles = {
  container: {
    display: "flex",
    alignItems: "center",
    height: "29px",
    marginBottom: "28px",
  },

  fields: {
    display: "flex",
    marginLeft: "16px",
    flexDirection: "column" as "column",
  },

  title: {
    fontSize: "24px",
    fontFamily: "Rubik",
    color: colors["title"],
  },

  subTitle: {
    color: colors["subTitle"],
    fontSize: "16px",
  },
};
